  const [showPassword, setShowPassword] = useState(false);
  const [bloodType, setBloodType] = useState('');
  const [gender, setGender] = useState('');
  const [dateOfBirth, setDateOfBirth] = useState('');
  const [phone, setPhone] = useState('');
  const [address, setAddress] = useState('');
  const [medicalHistory, setMedicalHistory] = useState('');
  const [category, setCategory] = useState('');
  const [error, setError] = useState('');
  const [availableAppointments, setAvailableAppointments] = useState([
    { startDay: '', endDay: '', startTime: '', endTime: '' }
  ]);

  const defa = () => {
    setUsername('');
    setLastname('');
    setAddress('');
    setBloodType('');
    setConfirmPassword('');
    setDateOfBirth('');
    setEmail('');
    setMedicalHistory('');
    setPassword('');
    setPhone('');
    setError('');
    setGender('');
    setCategory('');
    setAvailableAppointments([{ startDay: '', endDay: '', startTime: '', endTime: '' }]);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();

    if (password !== confirmPassword) {
      setError("Passwords do not match!");
      return;
    }

    const newUser = {
      username: username,
      lastname: lastname,
      email: email,
      password: password,
      gender: gender,
      bloodType: bloodType,
      dateOfBirth: dateOfBirth,
      phone: phone,
      address: address,
      medicalHistory: medicalHistory,
      category: category,
      availableAppointments: availableAppointments
    };

    try {
      const response = await axios.post('http://localhost:8800/api/auth/register', newUser);
      console.log(response.data);
      props.onHide();
      defa();
    } catch (error) {
      if (error.response && error.response.status === 400 && error.response.data === 'Email already exists') {
        setError('Email is already registered. Please use a different email.');
      } else {
        setError('Registration failed. Please try again.');
      }
    }
  };

  const toggleShowPassword = () => {
    setShowPassword(!showPassword);
  };

  const handleAddAppointmentSlot = () => {
    setAvailableAppointments([
      ...availableAppointments,
      { startDay: '', endDay: '', startTime: '', endTime: '' }
    ]);
  };

  const handleAppointmentInputChange = (index, event) => {
    const { name, value } = event.target;
    const updatedAppointments = [...availableAppointments];
    updatedAppointments[index][name] = value;
    setAvailableAppointments(updatedAppointments);
  };

  return (
    <div className='custom-modal'>
      <Modal
        {...props}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
        scrollable
        className="custom-modal-content"
        dialogClassName="custom-modal-dialog"
      >
        <Modal.Header closeButton className="custom-modal-header">
          <Modal.Title id="contained-modal-title-vcenter" className="text-center w-100">
            Register Here
          </Modal.Title>
        </Modal.Header>
        <Modal.Body className="custom-modal-body">
          <Form onSubmit={handleSubmit}>
            {error && <Alert variant="danger">{error}</Alert>}
            <Form.Group className="mb-3" controlId="userName">
              <Form.Label>User Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter your name"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                autoFocus
                required
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="lastName">
              <Form.Label>Last Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter your last name"
                value={lastname}
                onChange={(e) => setLastname(e.target.value)}
                required
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="email">
              <Form.Label>Email address</Form.Label>
              <Form.Control
                type="email"
                placeholder="name@example.com"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="password">
              <Form.Label>Password</Form.Label>
              <div className="password-field">
                <Form.Control
                  type={showPassword ? "text" : "password"}
                  placeholder="Password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  required
                />
                <Button variant="outline-secondary" onClick={toggleShowPassword}>
                  {showPassword ? "Hide" : "Show"}
                </Button>
              </div>
            </Form.Group>

            <Form.Group className="mb-3" controlId="confirmPassword">
              <Form.Label>Confirm Password</Form.Label>
              <div className="password-field">
                <Form.Control
                  type={showPassword ? "text" : "password"}
                  placeholder="Confirm Password"
                  value={confirmPassword}
                  onChange={(e) => setConfirmPassword(e.target.value)}
                  required
                />
              </div>
            </Form.Group>

            <Form.Group className="mb-3" controlId="gender">
              <Form.Label>Gender</Form.Label>
              <Form.Select
                value={gender}
                onChange={(e) => setGender(e.target.value)}
                required
              >
                <option value="">Select Gender</option>
                <option value="Male">Male</option>
                <option value="Female">Female</option>
                <option value="Other">Other</option>
              </Form.Select>
            </Form.Group>

            <Form.Group className="mb-3" controlId="bloodType">
              <Form.Label>Blood Type</Form.Label>
              <Form.Select
                value={bloodType}
                onChange={(e) => setBloodType(e.target.value)}
                required
              >
                <option value="">Select Blood Type</option>
                <option value="A+">A+</option>
                <option value="A-">A-</option>
                <option value="B+">B+</option>
                <option value="B-">B-</option>
                <option value="AB+">AB+</option>
                <option value="AB-">AB-</option>
                <option value="O+">O+</option>
                <option value="O-">O-</option>
              </Form.Select>
            </Form.Group>

            <Form.Group className="mb-3" controlId="dateOfBirth">
              <Form.Label>Date of Birth</Form.Label>
              <Form.Control
                type="date"
                value={dateOfBirth}
                onChange={(e) => setDateOfBirth(e.target.value)}
                required
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="phone">
              <Form.Label>Phone Number</Form.Label>
              <Form.Control
                type="tel"
                placeholder="Enter phone number"
                value={phone}
                onChange={(e) => setPhone(e.target.value)}
                required
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="address">
              <Form.Label>Address</Form.Label>
              <Form.Control
                as="textarea"
                placeholder="Enter address"
                value={address}
                onChange={(e) => setAddress(e.target.value)}
                required
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="medicalHistory">
              <Form.Label>Medical History</Form.Label>
              <Form.Control
                as="textarea"
                placeholder="Enter medical history"
                value={medicalHistory}
                onChange={(e) => setMedicalHistory(e.target.value)}
              />
            </Form.Group>

            <Form.Group className="mb-3" controlId="category">
              <Form.Label>Category</Form.Label>
              <Form.Control
                as="select"
                value={category}
                onChange={(e) => setCategory(e.target.value)}
                required
              >
                <option value="">Select Category</option>
                {/* Replace with your category options */}
                <option value="1">Category 1</option>
                <option value="2">Category 2</option>
                <option value="3">Category 3</option>
              </Form.Control>
            </Form.Group>

            <Form.Group className="mb-3" controlId="availableAppointments">
              <Form.Label>Available Appointments</Form.Label>
              {availableAppointments.map((slot, index) => (
                <div key={index}>
                  <Form.Group className="mb-3">
                    <Form.Label>Start Day</Form.Label>
                    <Form.Control
                      type="text"
                      placeholder="e.g., Monday"
                      value={slot.startDay}
                      onChange={(e) => handleAppointmentInputChange(index, e)}
                      name={`availableAppointments.${index}.startDay`}
                      required
                    />
                  </Form.Group>
                  <Form.Group className="mb-3">
                    <Form.Label>End Day</Form.Label>
                    <Form.Control
                      type="text"
                      placeholder="e.g., Friday"
                      value={slot.endDay}
                      onChange={(e) => handleAppointmentInputChange(index, e)}
                      name={`availableAppointments.${index}.endDay`}
                      required
                    />
                  </Form.Group>
                  <Form.Group className="mb-3">
                    <Form.Label>Start Time</Form.Label>
                    <Form.Control
                      type="text"
                      placeholder="e.g., 09:00 AM"
                      value={slot.startTime}
                      onChange={(e) => handleAppointmentInputChange(index, e)}
                      name={`availableAppointments.${index}.startTime`}
                      required
                    />
                  </Form.Group>
                  <Form.Group className="mb-3">
                    <Form.Label>End Time</Form.Label>
                    <Form.Control
                      type="text"
                      placeholder="e.g., 05:00 PM"
                      value={slot.endTime}
                      onChange={(e) => handleAppointmentInputChange(index, e)}
                      name={`availableAppointments.${index}.endTime`}
                      required
                    />
                  </Form.Group>
                </div>
              ))}
              <Button variant="outline-primary" onClick={handleAddAppointmentSlot}>
                Add Appointment Slot
              </Button>
            </Form.Group>

            <div className="text-center">
              <Button variant="success" type="submit">
                Register
              </Button>
            </div>
          </Form>
        </Modal.Body>
      </Modal>
    </div>
  );
}

export default AddDoctor1;
